import React from 'react'
import { Link } from 'react-router-dom'
import '../../App.css'
import Doctor from '../Doctor/Doctor';
import RegisterDoctor from '../RegisterDoctor/RegisterDoctor';
import LocalHospitalRoundedIcon from '@mui/icons-material/LocalHospitalRounded';
import { AppBar,Button,Tab,Tabs,Toolbar,Typography,useMediaQuery,useTheme,} from "@mui/material";
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';

const Header = () => {

const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);
  };

    
  return (
    <div className='header'>
        <React.Fragment>
            <AppBar sx={{ background: "#063970" }}>
            <Toolbar>
                <Typography sx={{ fontSize: "2rem", paddingLeft: "5%" }}>Doctor</Typography>
                <Tabs sx={{ marginLeft: "auto" }} indicatorColor="secondary" textColor="inherit">
                    <Tab href='/' label="Home" />
                    <Tab href='/doctors' label="Doctors" />
                    <Tab label="Patient Register" />
                    <Tab label="Contact" />
                <Button id="basic-button" aria-controls={open ? 'basic-menu' : undefined} aria-haspopup="true" aria-expanded={open ? 'true' : undefined}
        onClick={handleClick}
      >
        More
      </Button>
      <Menu
        id="basic-menu"
        anchorEl={anchorEl}
        open={open}
        onClose={handleClose}
        MenuListProps={{
          'aria-labelledby': 'basic-button',
        }}
      >
        <MenuItem onClick={handleClose}><Link to="/registerDoctor">Doctor Register</Link></MenuItem>
        <MenuItem onClick={handleClose}>Login</MenuItem>
        <MenuItem onClick={handleClose}>Logout</MenuItem>
      </Menu>
        </Tabs>
        </Toolbar>
        </AppBar>
        </React.Fragment>
    </div>
  )
}

export default Header
